import React, { Component } from 'react';

class Home extends Component {
    render() {
        return (
            <div className="container">
                <div>
                    <div className="row">
                        <div className="col-md-6">
                            <img src="/img/product-0" alt=""/>
                        </div>
                        <div className="col-md-6">
                        <img src="/img/product-01" alt=""/>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
